import React, { useContext } from "react";
import UserService from "./../00-Context/UserService";
import axios from "axios";

const Cart = () => {
  const userService = useContext(UserService);

  var products = [];

  let urlBuilder =
    "https://itpro2017.herokuapp.com/api/users/" +
    userService.username +
    "/cart-products";
  axios
    .get(urlBuilder)
    .then(response => {
      products = response.data;
    })
    .catch(error => {
      console.log(error);
    });

  console.log(userService.username);
  console.log(products);
  return <h1>{userService.username}</h1>;
};

export default Cart;
